INSERT INTO `movies` (`id`, `name`, `duration`, `synopsis`, `trailer`, `year`, `poster`, `slug`, `director_id`, `country_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(2, 'Avengers Infinity War', '156', 'El todopoderoso Thanos ha despertado con la promesa de arrasar con todo a su paso, portando el Guantelete del Infinito, que le confiere un poder incalculable. Los únicos capaces de pararle los pies son los Vengadores y el resto de superhéroes de la galaxia, que deberán estar dispuestos a sacrificarlo todo por un bien mayor. Capitán América e Ironman deberán limar sus diferencias, Black Panther apoyará con sus tropas desde Wakanda, Thor y los Guardianes de la Galaxia e incluso Spider-Man se unirán antes de que los planes de devastación y ruina pongan fin al universo. ¿Serán capaces de frenar el avance del titán del caos?', '{\"provider\":\"youtube\",\"id\":\"-f5PwE_Q8Fs\",\"title\":\"Vengadores: Infinity War de Marvel | Nuevo  Tráiler Oficial en español | HD\",\"image\":\"https://i.ytimg.com/vi/-f5PwE_Q8Fs/maxresdefault.jpg\",\"url\":\"https://www.youtube.com/watch?v=-f5PwE_Q8Fs\"}', '2018', 'data:image/jpeg;base64,', 'avengers-infinity-war', 1, 1, '2019-05-05 04:26:09', '2019-05-16 08:43:49', NULL);
INSERT INTO `movies` (`id`, `name`, `duration`, `synopsis`, `trailer`, `year`, `poster`, `slug`, `director_id`, `country_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(3, 'V de Venganza', '132', 'En un futuro no muy lejano, Gran Bretaña se ha convertido en un país totalitario dirigido con mano de hierro por un tirano (John Hurt). Una tarde, tras el toque de queda, Evey (Natalie Portman) es rescatada en plena calle por un misterioso enmascarado cuyo nombre es \"V\" (Hugo Weaving). El extraño personaje le explica cuáles son sus planes para recuperar la libertad. En efecto, todas las acciones de V tendrán como objetivo hacer estallar en todo el país una revolución contra el gobierno fascista.', '{\"provider\":\"vimeo\",\"id\":18176393,\"title\":\"V for Vendetta Movie Trailer\",\"image\":\"https://i.vimeocdn.com/video/114000201_640.jpg\",\"url\":\"https://vimeo.com/18176393\"}', '2006', 'data:image/jpeg;base64,', 'v-de-venganza', 5, 1, '2019-05-05 06:07:53', '2019-05-05 06:10:11', NULL);
INSERT INTO `movies` (`id`, `name`, `duration`, `synopsis`, `trailer`, `year`, `poster`, `slug`, `director_id`, `country_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(4, 'E.T. El Extraterrestre', '121', 'Un pequeño ser de otro planeta se queda abandonado en la Tierra cuando su nave, al emprender el regreso, se olvida de él. Está completamente solo y tiene miedo, pero se hará amigo de un niño, que lo esconde en su casa. El pequeño y sus hermanos intentan encontrar la forma de que el pequeño extraterrestre regrese a su planeta antes de que lo encuentren los científicos y la policía.', '{\"provider\":\"youtube\",\"id\":\"MwNuAz-Yt8k\",\"title\":\"E.T. El Extraterrestre (Trailer 20º Aniversario 2002 subtitulado en español)\",\"image\":\"https://i.ytimg.com/vi/MwNuAz-Yt8k/maxresdefault.jpg\",\"url\":\"https://www.youtube.com/watch?v=MwNuAz-Yt8k\"}', '1982', 'data:image/jpeg;base64,', 'et-el-extraterrestre', 3, 1, '2019-05-07 17:44:39', '2019-05-07 17:48:25', NULL);
INSERT INTO `movies` (`id`, `name`, `duration`, `synopsis`, `trailer`, `year`, `poster`, `slug`, `director_id`, `country_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(5, 'Avengers Endgame', '182', 'Después de los eventos devastadores de \'Avengers: Infinity War\', el universo está en ruinas debido a las acciones de Thanos, el Titán Loco. Con la ayuda de los aliados que quedaron, los Vengadores deberán reunirse una vez más para intentar deshacer sus acciones y restaurar el orden en el universo de una vez por todas, sin importar cuáles son las consecuencias... Cuarta y última entrega de la saga \'Vengadores\'.', '{\"provider\":\"youtube\",\"id\":\"0jNvJU52LvU\",\"title\":\"Marvel Studios’ Avengers: Endgame | “To the End”\",\"image\":\"https://i.ytimg.com/vi/0jNvJU52LvU/maxresdefault.jpg\",\"url\":\"https://www.youtube.com/watch?v=0jNvJU52LvU\"}', '2019', 'data:image/jpeg;base64,', 'avengers-endgame', 1, 1, '2019-05-07 17:44:39', '2019-05-07 17:51:57', NULL);
INSERT INTO `movies` (`id`, `name`, `duration`, `synopsis`, `trailer`, `year`, `poster`, `slug`, `director_id`, `country_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(6, 'Tiburón', '124', 'En la costa de un pequeño pueblo del Este de los Estados Unidos, un enorme tiburón ataca a varias personas. Por temor a los nefastos efectos que este hecho podría tener sobre el negocio turístico, el alcalde se niega a cerrar las playas y a difundir la noticia. Pero un nuevo ataque del tiburón termina con la vida de un bañista. Cuando el terror se apodera de todos, un veterano cazador de tiburones, un oceanógrafo y el jefe de la policía local se unen para capturar al escualo..', '{\"provider\":\"youtube\",\"id\":\"JvF0ECpkrqw\",\"title\":\"Trailer Tiburon HD 1975\",\"image\":\"https://i.ytimg.com/vi/JvF0ECpkrqw/maxresdefault.jpg\",\"url\":\"https://www.youtube.com/watch?v=JvF0ECpkrqw\"}', '1975', 'data:image/jpeg;base64,', 'tiburon', 3, 1, '2019-05-07 17:44:39', '2019-05-07 17:54:33', NULL);
INSERT INTO `movies` (`id`, `name`, `duration`, `synopsis`, `trailer`, `year`, `poster`, `slug`, `director_id`, `country_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(7, 'Avatar', '161', 'Año 2154. Jake Sully (Sam Worthington), un ex-marine condenado a vivir en una silla de ruedas, sigue siendo, a pesar de ello, un auténtico guerrero. Precisamente por ello ha sido designado para ir a Pandora, donde algunas empresas están extrayendo un mineral extraño que podría resolver la crisis energética de la Tierra. Para contrarrestar la toxicidad de la atmósfera de Pandora, se ha creado el programa Avatar, gracias al cual los seres humanos mantienen sus conciencias unidas a un avatar: un cuerpo biológico controlado de forma remota que puede sobrevivir en el aire letal. Esos cuerpos han sido creados con ADN humano, mezclado con ADN de los nativos de Pandora, los Na\'vi. Convertido en avatar, Jake puede caminar otra vez. Su misión consiste en infiltrarse entre los Na\'vi, que se han convertido en el mayor obstáculo para la extracción del mineral. Pero cuando Neytiri, una bella Na\'vi (Zoe Saldana), salva la vida de Jake, todo cambia: Jake, tras superar ciertas pruebas, es admitido en su clan. Mientras tanto, los hombres esperan los resultados de la misión de Jake.', '{\"provider\":\"youtube\",\"id\":\"tLylzuf1MWA\",\"title\":\"AVATAR - SPECIAL EDITION\",\"image\":\"https://i.ytimg.com/vi/tLylzuf1MWA/maxresdefault.jpg\",\"url\":\"https://www.youtube.com/watch?v=tLylzuf1MWA\"}', '2009', 'data:image/jpeg;base64,', 'avatar', 2, 1, '2019-05-07 17:44:39', '2019-05-07 17:56:19', NULL);
INSERT INTO `movies` (`id`, `name`, `duration`, `synopsis`, `trailer`, `year`, `poster`, `slug`, `director_id`, `country_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(8, 'Titanic', '195', 'Jack (DiCaprio), un joven artista, gana en una partida de cartas un pasaje para viajar a América en el Titanic, el transatlántico más grande y seguro jamás construido. A bordo conoce a Rose (Kate Winslet), una joven de una buena familia venida a menos que va a contraer un matrimonio de conveniencia con Cal (Billy Zane), un millonario engreído a quien sólo interesa el prestigioso apellido de su prometida. Jack y Rose se enamoran, pero el prometido y la madre de ella ponen todo tipo de trabas a su relación. Mientras, el gigantesco y lujoso transatlántico se aproxima hacia un inmenso iceberg.', '{\"provider\":\"youtube\",\"id\":\"FiRVcExwBVA\",\"title\":\"Titanic 3D - Tráiler en español\",\"image\":\"https://i.ytimg.com/vi/FiRVcExwBVA/maxresdefault.jpg\",\"url\":\"https://www.youtube.com/watch?v=FiRVcExwBVA\"}', '1997', 'data:image/jpeg;base64,', 'titanic', 2, 1, '2019-05-07 17:44:39', '2019-05-07 18:02:08', NULL);
INSERT INTO `movies` (`id`, `name`, `duration`, `synopsis`, `trailer`, `year`, `poster`, `slug`, `director_id`, `country_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(9, 'Tiempos Violentos', '153', 'Jules y Vincent, dos asesinos a sueldo con no demasiadas luces, trabajan para el gángster Marsellus Wallace. Vincent le confiesa a Jules que Marsellus le ha pedido que cuide de Mia, su atractiva mujer. Jules le recomienda prudencia porque es muy peligroso sobrepasarse con la novia del jefe. Cuando llega la hora de trabajar, ambos deben ponerse \'manos a la obra\'. Su misión: recuperar un misterioso maletín.', '{\"provider\":\"youtube\",\"id\":\"LI1yt38A9-E\",\"title\":\"Pulp Fiction (1994) - Opening Credits\",\"image\":\"https://i.ytimg.com/vi/LI1yt38A9-E/maxresdefault.jpg\",\"url\":\"https://www.youtube.com/watch?v=LI1yt38A9-E\"}', '1994', 'data:image/jpeg;base64,', 'tiempos-violentos', 4, 1, '2019-05-07 17:44:40', '2019-05-07 18:02:48', NULL);
INSERT INTO `movies` (`id`, `name`, `duration`, `synopsis`, `trailer`, `year`, `poster`, `slug`, `director_id`, `country_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(10, 'Perros de Reserva', '99', 'Una banda organizada es contratada para atracar una empresa y llevarse unos diamantes. Sin embargo, antes de que suene la alarma, la policía ya está allí. Algunos miembros de la banda mueren en el enfrentamiento con las fuerzas del orden, y los demás se reúnen en el lugar convenido', '{\"provider\":\"youtube\",\"id\":\"OXqI6CrT9Fg\",\"title\":\"Reservoir Dogs (trailer en castellano)\",\"image\":\"https://i.ytimg.com/vi/OXqI6CrT9Fg/default.jpg\",\"url\":\"https://www.youtube.com/watch?v=OXqI6CrT9Fg\"}', '1992', 'data:image/jpeg;base64,', 'perros-de-reserva', 4, 1, '2019-05-07 17:44:40', '2019-05-07 18:04:05', NULL);
INSERT INTO `movies` (`id`, `name`, `duration`, `synopsis`, `trailer`, `year`, `poster`, `slug`, `director_id`, `country_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(11, 'Kill Bill', '150', 'Killbill mata a medio mundo', '{\"provider\":\"vimeo\",\"id\":92251044,\"title\":\"killbill c10 Awareness Campaign\",\"image\":\"https://i.vimeocdn.com/video/471924222_640.jpg\",\"url\":\"https://vimeo.com/92251044\"}', '2004', 'data:image/jpeg;base64,', 'kill-bill', 4, 1, '2019-05-07 17:44:40', '2019-05-07 18:07:24', NULL);
INSERT INTO `movies` (`id`, `name`, `duration`, `synopsis`, `trailer`, `year`, `poster`, `slug`, `director_id`, `country_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(12, 'El Resplandor', '146', 'Jack Torrance se traslada con su mujer y su hijo de siete años al impresionante hotel Overlook, en Colorado, para encargarse del mantenimiento de las instalaciones durante la temporada invernal, época en la que permanece cerrado y aislado por la nieve. Su objetivo es encontrar paz y sosiego para escribir una novela. Sin embargo, poco después de su llegada al hotel, al mismo tiempo que Jack empieza a padecer inquietantes trastornos de personalidad, se suceden extraños y espeluznantes fenómenos paranormales.', '{\"provider\":\"youtube\",\"id\":\"A3q03BBwMp4\",\"title\":\"El resplandor - Trailer\",\"image\":\"https://i.ytimg.com/vi/A3q03BBwMp4/default.jpg\",\"url\":\"https://www.youtube.com/watch?v=A3q03BBwMp4\"}', '1980', 'data:image/jpeg;base64,', 'el-resplandor', 6, 1, '2019-05-13 23:29:41', '2019-05-13 23:42:06', NULL);

